import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Sidebar from '../Sidebar';
import Divider from '@mui/material/Divider';
import { Button } from '@mui/material';

let currentSection = 'dev_info1';
const getCurrentSection = () => {
  console.log(currentSection);
};

function About() {
  return (
    <div className='App-body'>
      <Sidebar />
      <div className='App-body-main scroll-wrapper'>
        <h1>About Us</h1>
        <Divider
          variant='middle'
          sx={{
            borderColor: 'white',
          }}
        >
        </Divider>
        <Button onClick={getCurrentSection}>click me</Button>
        <div id='dev_info'>
          <p>This is going to be some info about me!</p>
        </div>
        <div id='project_info'>
          <p>This is going to be some info about what I did!</p>
        </div>
      </div>
    </div>
  );
}

export default About;
